import React from "react";
import MakeAClaim from"./assets/images/MakeAClaim.png";

const MakeCalm = () =>{
    return(
      <>
      <div className="home_page">
          <div className="top_img">
            <img src={MakeAClaim } alt="MakeClaim"/>
          </div>
      </div>
    </>
    ) 
   
};
export default MakeCalm;
